import React from 'react';
import Main from './component/Main';
import {BrowserRouter, Route, Routes} from "react-router-dom";

export default function App() {
  return (
    <div className="App">
      <BrowserRouter>
         <Routes>
           <Route path='/' element={<Main/>} />
         </Routes>
      </BrowserRouter>
    </div>
  );
}
